B.aaq=new A.a3("1. CONSTITUCI\xd3N DE LA REP\xdaBLICA BOLIVARIANA DE VENEZUELA. ",null,B.E,null,null,null,null,null,null)
B.Jg=new A.cO(B.x,null,null,B.aaq,null)
B.aaw=new A.a3("G.O.R.B.V N\xb0 36.860 de fecha 30 de diciembre de 1.999.",null,B.F,null,null,null,null,null,null)
B.Jl=new A.cO(B.x,null,null,B.aaw,null)
B.aaj=new A.a3("Cap\xedtulo III. De los Derechos Civiles \nArt\xedculo 51.",null,B.E,null,null,null,null,null,null)
B.aas=new A.a3("Toda persona tiene el derecho de representar o dirigir peticiones ante cualquier autoridad, funcionario p\xfablico o funcionaria p\xfablica sobre los asuntos que sean de la competencia de \xe9stos o \xe9stas, y de obtener oportuna y adecuada respuesta. Quienes violen este derecho ser\xe1n sancionados o sancionadas conforme a la ley, pudiendo ser destituidos o destituidas del cargo respectivo.",null,B.F,B.m,null,null,null,null,null)
B.aad=new A.a3("T\xcdTULO IV. DEL PODER P\xdaBLICO ",null,B.E,null,null,null,null,null,null)
B.a9O=new A.a3("Cap\xedtulo I. Secci\xf3n Segunda: De la Administraci\xf3n P\xfablica \nArt\xedculo 141.",null,B.E,null,null,null,null,null,null)
B.a9G=new A.a3("La Administraci\xf3n P\xfablica est\xe1 al servicio de los ciudadanos y ciudadanas y se fundamenta en los principios de honestidad, participaci\xf3n, celeridad, eficacia, eficiencia, transparencia, rendici\xf3n de cuentas y responsabilidad en el ejercicio de la funci\xf3n p\xfablica, con sometimiento pleno a la ley y al derecho.",null,B.F,B.m,null,null,null,null,null)
B.a9e=new A.a3("2. LEY ORG\xc1NICA DE LA ADMINISTRACI\xd3N P\xdaBLICA. ",null,B.E,null,null,null,null,null,null)
B.Jm=new A.cO(B.x,null,null,B.a9e,null)
B.aai=new A.a3("G.O.R.B.V N\xb0 37.305 de fecha 17 de octubre de 2001.",null,B.F,null,null,null,null,null,null)
B.Jp=new A.cO(B.x,null,null,B.aai,null)
B.a9i=new A.a3("Art\xedculo 3. Objetivo de la Administraci\xf3n P\xfablica ",null,B.E,null,null,null,null,null,null)
B.a93=new A.a3("La Administraci\xf3n P\xfablica tendr\xe1 como objetivo de su organizaci\xf3n y funcionamiento hacer efectivos los principios, valores y normas consagrados en la Constituci\xf3n de la Rep\xfablica Bolivariana de Venezuela y en especial, garantizar a todas las personas, el goce y ejercicio de los derechos humanos.",null,B.F,B.m,null,null,null,null,null)
B.a9y=new A.a3("Art\xedculo 5. Principio de la Administraci\xf3n P\xfablica al servicio de las personas ",null,B.E,null,null,null,null,null,null)
B.a9j=new A.a3("La Administraci\xf3n P\xfablica est\xe1 al servicio de las personas, y su actuaci\xf3n estar\xe1 dirigida a la atenci\xf3n de sus requerimientos y la satisfacci\xf3n de sus necesidades, brindando especial atenci\xf3n a las de car\xe1cter social.\n\nLa Administraci\xf3n P\xfablica debe asegurar a todas las personas la efectividad de sus derechos cuando se relacionen con ella.\n\nAdem\xe1s, tendr\xe1 entre sus objetivos la continua mejora de los procedimientos, servicios y prestaciones p\xfablicas, de acuerdo con las pol\xedticas que se dicten.",null,B.F,B.m,null,null,null,null,null)
B.a9f=new A.a3("Art\xedculo 6. Garant\xedas que debe ofrecer la Administraci\xf3n P\xfablica a las personas.",null,B.E,null,null,null,null,null,null)
B.a9n=new A.a3("La Administraci\xf3n P\xfablica desarrollar\xe1 su actividad y se organizar\xe1 de manera que las personas puedan:\n\n1. Resolver sus asuntos, ser auxiliadas en la redacci\xf3n formal de documentos administrativos; y recibir informaci\xf3n de su inter\xe9s por cualquier medio escrito, oral, telef\xf3nico, electr\xf3nico e inform\xe1tico;\n\n2. Presentar reclamaciones sobre el funcionamiento de la Administraci\xf3n P\xfablica;\n\n3. Acceder f\xe1cilmente a informaci\xf3n actualizada sobre el esquema de organizaci\xf3n de los \xf3rganos y entes de la Administraci\xf3n P\xfablica, as\xed como a gu\xedas informativas sobre los procedimientos administrativos, servicios y prestaciones que ellos ofrecen.",null,B.F,B.m,null,null,null,null,null)
B.a9D=new A.a3("3. LEY ORG\xc1NICA DE PROCEDIMIENTOS ADMINISTRATIVOS",null,B.E,null,null,null,null,null,null)
