B.a8O=new A.a3("Los funcionarios y dem\xe1s personas que presten servicios en la administraci\xf3n p\xfablica, est\xe1n en la obligaci\xf3n de tramitar los asuntos cuyo conocimiento les corresponda y son responsables por las faltas en que incurran. \n\nLos interesados podr\xe1n reclamar, ante el superior jer\xe1rquico inmediato, del retardo, omisi\xf3n, distorsi\xf3n o incumplimiento de cualquier procedimiento, tr\xe1mite o plazo, en que incurrieren los funcionarios responsables del asunto. \n\nEste reclamo deber\xe1 interponerse en forma escrita y razonada y ser\xe1 resuelto dentro de los quince (15) d\xedas siguientes. La reclamaci\xf3n no acarrear\xe1 la paralizaci\xf3n del procedimiento, ni obstaculizar\xe1 la posibilidad de que sean subsanadas las fallas u omisiones. Si el superior jer\xe1rquico encontrare fundado el reclamo, impondr\xe1 al infractor o infractores la sanci\xf3n prevista en el art\xedculo 100 de la presente Ley sin perjuicio de las dem\xe1s responsabilidades y sanciones a que hubiere lugar.\n\n",null,B.F,B.m,null,null,null,null,null)
B.a9c=new A.a3("4. LEY ORG\xc1NICA DE LA CONTRALOR\xcdA GENERAL DE LA REP\xdaBLICA.",null,B.E,null,null,null,null,null,null)
