B.Jq=new A.cO(B.x,null,null,B.a9a,null)
B.a9E=new A.a3("Art\xedculo 25. Numeral 7",null,B.E,null,null,null,null,null,null)
B.aa8=new A.a3("El Sistema Nacional de Control Fiscal se regir\xe1 por los siguientes principios:\n\n La participaci\xf3n de la ciudadan\xeda en la gesti\xf3n contralora.",null,B.F,B.m,null,null,null,null,null)
B.a9q=new A.a3("Cap\xedtulo VIII De la participaci\xf3n ciudadana  \nArt\xedculo 75.",null,B.E,null,null,null,null,null,null)
B.aau=new A.a3("El Contralor o Contralora General de la Rep\xfablica, mediante resoluci\xf3n que se publicar\xe1 en la Gaceta Oficial de la Rep\xfablica Bolivariana de Venezuela, dictar\xe1 las normas destinadas a fomentar la participaci\xf3n de los ciudadanos y ciudadanas, haciendo especial \xe9nfasis en los siguientes aspectos:\n\n\u20262. Ordenar, dirigir, sistematizar y evaluar las denuncias ciudadanas que provengan de las instancias que ejercen la contralor\xeda social.",null,B.F,B.m,null,null,null,null,null)
B.a9r=new A.a3("Art\xedculo 96.",null,B.E,null,null,null,null,null,null)
B.a9m=new A.a3("Si como consecuencia del ejercicio de las funciones de control o de las potestades investigativas establecidas en esta Ley, surgieren elementos de convicci\xf3n o prueba que pudieran dar lugar a la formulaci\xf3n de reparos, a la declaratoria de responsabilidad administrativa o a la imposici\xf3n de multas, el \xf3rgano de control fiscal respectivo iniciar\xe1 el procedimiento mediante auto motivado que se notificar\xe1 a los interesados o interesadas , seg\xfan lo previsto en la Ley Org\xe1nica de Procedimientos Administrativos.",null,B.F,B.m,null,null,null,null,null)
B.aa3=new A.a3("5. LEY DE INFOGOBIERNO",null,B.E,null,null,null,null,null,null)
