B.aao=new A.a3("G.O.R.B.V N\xba 37.313 30 de octubre de 2001 ",null,B.F,null,null,null,null,null,null)
B.Jj=new A.cO(B.x,null,null,B.aao,null)
B.a96=new A.a3("Art\xedculo 8. Numeral 8. Derecho de las personas.",null,B.E,null,null,null,null,null,null)
B.a9F=new A.a3("En las relaciones con el Poder P\xfablico y el Poder Popular, las personas tienen derecho a: \n\n \u20268. Disponer de mecanismos que permitan el ejercicio de la contralor\xeda social haciendo uso de las tecnolog\xedas de informaci\xf3n.",null,B.F,B.m,null,null,null,null,null)
B.a94=new A.a3("Art\xedculo 14. Principio de accesibilidad.",null,B.E,null,null,null,null,null,null)
B.aa_=new A.a3("El Poder P\xfablico, en forma corresponsable con el Poder Popular, participa en el desarrollo, implementaci\xf3n y uso de las tecnolog\xedas de informaci\xf3n libres, a fin de garantizar a las personas, en igualdad de condiciones, el acceso y la apropiaci\xf3n social del conocimiento asociado a esas tecnolog\xedas.",null,B.F,B.m,null,null,null,null,null)
B.aa0=new A.a3("Art\xedculo 20. Derecho a la participaci\xf3n en la promoci\xf3n de los servicios y uso de las tecnolog\xedas de informaci\xf3n.",null,B.E,null,null,null,null,null,null)
B.a9p=new A.a3("El Poder P\xfablico y el Poder Popular est\xe1n obligados a garantizar en sus portales de internet el ejercicio del derecho de las personas a participar, colaborar y promover el uso de las tecnolog\xedas de informaci\xf3n libres, creaci\xf3n de nuevos servicios electr\xf3nicos o mejoramiento de los ya existentes.",null,B.F,B.m,null,null,null,null,null)
B.a9S=new A.a3("Art\xedculo 21. Mecanismos de ejercicio de contralor\xeda social.",null,B.E,null,null,null,null,null,null)
B.aal=new A.a3("Los servicios prestados por el Poder P\xfablico y el Poder Popular deben contener mecanismos que permitan la promoci\xf3n, desarrollo y consolidaci\xf3n de la contralor\xeda social como medio de participaci\xf3n de las personas y sus organizaciones sociales, para garantizar que la inversi\xf3n p\xfablica se realice de manera transparente y eficiente, en beneficio de los intereses de la sociedad y que las actividades del sector privado no afecten los intereses colectivos o sociales.",null,B.F,B.m,null,null,null,null,null)
B.a8T=new A.a3("6. LEY DE SIMPLIFICACI\xd3N DE TR\xc1MITES ADMINISTRATIVOS.",null,B.E,null,null,null,null,null,null)
B.Jn=new A.cO(B.x,null,null,B.a8T,null)
B.aa9=new A.a3("G.O.R.B.V N\xb0 40.549, de fecha 26 de noviembre de 2014",null,B.F,null,null,null,null,null,null)
B.Jc=new A.cO(B.x,null,null,B.aa9,null)
B.a9s=new A.a3("Art\xedculo 36.",null,B.E,null,null,null,null,null,null)
B.aa4=new A.a3("Las funcionarias o funcionarios p\xfablicos, las trabajadoras y trabajadores de la Administraci\xf3n P\xfablica y, en general, quienes en cualquier situaci\xf3n de empleo p\xfablico deban prestar un servicio a las personas con ocasi\xf3n del cumplimiento de un tr\xe1mite administrativo, ser\xe1n considerados servidoras y servidores p\xfablicos a los fines del presente Decreto con Rango, Valor y Fuerza de Ley, obligados a procurar la mayor eficiencia y la m\xe1s esmerada y amable atenci\xf3n a todas aquellas personas que realizan tr\xe1mites ante la Administraci\xf3n P\xfablica, en los cuales se requiera su concurso.",null,B.F,B.m,null,null,null,null,null)
B.a9t=new A.a3("Art\xedculo 38.",null,B.E,null,null,null,null,null,null)
B.a9T=new A.a3("Los \xf3rganos y entes de la Administraci\xf3n P\xfablica, tienen el deber de ofrecer a las personas informaci\xf3n completa, oportuna y veraz en relaci\xf3n con los tr\xe1mites que se realicen ante los mismos. La Administraci\xf3n P\xfablica dar\xe1 preferencia al uso de tecnolog\xedas de informaci\xf3n, por medios de acceso remoto, a los fines de mantener informado al interesado sobre las resultas, el estado y dem\xe1s notificaciones relacionados con el tr\xe1mite de su inter\xe9s. Los \xf3rganos y entes de la Administraci\xf3n P\xfablica, deber\xe1n tener disponibles en sus sitios de Internet, v\xednculos que permitan a los interesados acceder a informaci\xf3n sobre sus tr\xe1mites. Adicionalmente, en las oficinas y establecimientos en los cuales se d\xe9 inicio a cualesquiera tr\xe1mites administrativos, la m\xe1xima autoridad de dicha oficina o establecimiento ser\xe1 responsable de la fijaci\xf3n en sitio visible al p\xfablico de los requisitos exigidos para cada tr\xe1mite, las oficinas que intervienen y su ubicaci\xf3n, la identificaci\xf3n del funcionario responsable del tr\xe1mite, su duraci\xf3n aproximada, los derechos de las personas en relaci\xf3n con el tr\xe1mite o servicio en cuesti\xf3n y la forma en que se pueden dirigir sus quejas, reclamos y sugerencias. Esta informaci\xf3n se publicar\xe1 adem\xe1s mediante gu\xedas simples de consulta p\xfablica, suministradas en forma gratuita, y deber\xe1 d\xe1rseles la publicidad necesaria a trav\xe9s de cualquier medio de comunicaci\xf3n, entre otros, visual, oral, escrito, inform\xe1tico o telem\xe1tico.",null,B.F,B.m,null,null,null,null,null)
B.aat=new A.a3("Art\xedculo 41. Servicio de atenci\xf3n al p\xfablico. ",null,B.E,null,null,null,null,null,null)
B.a99=new A.a3("Cada uno de los \xf3rganos y entes de la Administraci\xf3n P\xfablica deber\xe1 crear un servicio de atenci\xf3n al p\xfablico, encargado de brindar toda la orientaci\xf3n y apoyo necesario a las personas en relaci\xf3n con los tr\xe1mites que se realicen ante ellos, prestar servicios de recepci\xf3n y entrega de documentos, solicitudes y requerimientos en general, as\xed como recibir y procesar las denuncias, sugerencias y quejas que, en torno al servicio y a la actividad administrativa se formulen. Dichos servicios de atenci\xf3n al p\xfablico estar\xe1n bajo la supervisi\xf3n de la autoridad nacional unificada en materia de tr\xe1mites administrativos, la cual podr\xe1 dictar regulaciones especiales sobre su funcionamiento, de obligatorio cumplimiento para todos los \xf3rganos y entes de la Administraci\xf3n P\xfablica. Los \xf3rganos y entes de la Administraci\xf3n P\xfablica, incluso de distintos Poderes P\xfablicos o distintas entidades o unidades pol\xedtico territoriales, podr\xe1n suscribir encomiendas convenidas mediante las cuales acuerden la gesti\xf3n conjunta de varios tr\xe1mites, de manera parcial o total. En estas encomiendas convenidas podr\xe1n disponer el funcionamiento de varios organismos en una sola oficina, establecimiento, taquilla o ventanilla de atenci\xf3n, pudiendo establecer acuerdos especiales referidos al pago de determinados gastos de manera conjunta, indicando expresamente el porcentaje o la clase de gastos que corresponder\xe1 a cada \xf3rgano o ente.",null,B.F,B.m,null,null,null,null,null)
B.aae=new A.a3("7. LEY PARA EL RESPETO DE LOS DERECHOS HUMANOS EN EL EJERCICIO DE LA FUNCI\xd3N P\xdaBLICA.",null,B.E,null,null,null,null,null,null)
