B.a8P=new A.a3("Esta Ley tiene por objeto establecer los principios fundamentales y normas generales que permitan fortalecer el respeto, garant\xeda y protecci\xf3n de los derechos humanos en el ejercicio de la funci\xf3n p\xfablica.",null,B.F,B.m,null,null,null,null,null)
