B.a9Q=new A.a3("Art\xedculo 86. Alardeamiento o valimiento de relaciones o influencias.",null,B.E,null,null,null,null,null,null)
B.aax=new A.a3("La persona que alardeando de valimiento o de relaciones de importancia e influencia con cualquier funcionaria p\xfablica o funcionario p\xfablico reciba o se haga prometer, para s\xed o para otro, dinero o cualquier otra utilidad, bien como est\xedmulo o recompensa de su mediaci\xf3n, bien so pretexto de remunerar el logro de favores, ser\xe1 penada o penado con prisi\xf3n de dos (2) a siete (7) a\xf1os; y con prisi\xf3n de seis (6) meses a dos (2) a\xf1os, a quien d\xe9 o prometa el dinero o cualquier otra utilidad de las que se indican en este art\xedculo, a menos que haya denunciado el hecho ante la autoridad competente antes de la iniciaci\xf3n del correspondiente proceso judicial.",null,B.F,B.m,null,null,null,null,null)
B.a8W=new A.a3("Art\xedculo 89. Denuncia o acusaci\xf3n falsa",null,B.E,null,null,null,null,null,null)
B.a9L=new A.a3("Cualquiera que falsamente denunciare o acusare a otra persona de la comisi\xf3n de alguno o algunos de los hechos punibles previstos en esta Ley, ser\xe1 castigada con prisi\xf3n de uno (1) a tres (3) a\xf1os. ",null,B.F,B.m,null,null,null,null,null)
B.a9o=new A.a3("Art\xedculo 90. Promesa de soborno a funcionaria p\xfablica o funcionario p\xfablico.",null,B.E,null,null,null,null,null,null)
B.a9k=new A.a3("Quien por s\xed o por persona interpuesta prometa, ofrezca u otorgue a una funcionaria p\xfablica o funcionario p\xfablico de otro Estado, directa o indirectamente, por parte de sus nacionales, personas que tengan residencia habitual en su territorio y empresas domiciliadas en \xe9l, cualquier objeto de valor pecuniario u otros beneficios, como d\xe1divas, favores, promesas, ventajas a cambio de que dicha funcionaria o funcionario realice u omita cualquier acto, en el ejercicio de sus funciones p\xfablicas, relacionado con una transacci\xf3n de naturaleza econ\xf3mica, comercial o de cualquier otra \xedndole, ser\xe1 penada o penado con prisi\xf3n de seis (6) a doce (12) a\xf1os.",null,B.F,B.m,null,null,null,null,null)
B.a8Q=new A.a3("9. C\xd3DIGO DE CONDUCTA DE LOS SERVIDORES P\xdaBLICOS.",null,B.E,null,null,null,null,null,null)
