B.a9A=new A.a3("T\xcdTULO II PRINCIPIOS \xc9TICOS DEL SERVIDOR P\xdaBLICO\n\nArt\xedculo 3.",null,B.E,null,null,null,null,null,null)
B.aaa=new A.a3("A los efectos de este C\xf3digo son principios rectores de los deberes y conductas de los servidores p\xfablicos respecto a los valores \xe9ticos que han de regir la funci\xf3n p\xfablica: a) La honestidad. b) La equidad. c) El decoro. d) La lealtad. e) La vocaci\xf3n de servicio. f) La disciplina. g) La eficacia. h) La responsabilidad. i) La puntualidad. j) La transparencia k) La pulcritud.",null,B.F,B.m,null,null,null,null,null)
B.aa5=new A.a3("10. C\xd3DIGO DE \xc9TICA PARA EL FUNCIONARIO P\xdaBLICO",null,B.E,null,null,null,null,null,null)
