B.aar=new A.a3("Art\xedculo 1. Corresponde a los funcionarios p\xfablicos: ",null,B.E,null,null,null,null,null,null)
B.a9K=new A.a3("Salvaguardar en todo momento y en cada una de sus actuaciones, los intereses generales del Estado y en la preservaci\xf3n del patrimonio p\xfablico. 2. Actuar con estricto apego a las leyes y a todas las dem\xe1s normas e instrucciones que deben regir su comportamiento en la realizaci\xf3n cabal de todas las tareas que tenga asignadas. 3. Dedicar todos sus esfuerzos para cumplir, con la m\xe1xima eficiencia y la m\xe1s alta \n eficacia, la misi\xf3n que le est\xe9 encomendada. 4. Realizar permanentemente actividades de superaci\xf3n personal y de colaboraci\xf3n en el mejoramiento institucional de la administraci\xf3n p\xfablica y, en particular, del organismo donde preste sus servicios. 5. Rehusar con firmeza inequ\xedvoca el mantenimiento de relaciones o de intereses, con personas u organizaciones, que sean incompatibles con sus cargos y con las atribuciones y funciones que le est\xe9n asignadas. 6. Proceder con objetividad e imparcialidad en todas las decisiones que le corresponda tomar y en los asuntos en los que deba intervenir. 7. Rechazar en cualquier caso y circunstancia y no solicitar jam\xe1s, ni para s\xed mismos ni para terceros, pagos, beneficios o privilegios en ocasi\xf3n de los servicios que deba prestar. 8. Ajustar su conducta, de modo estricto y sin excepciones, a favor de la transparencia en la administraci\xf3n p\xfablica manteniendo la confidencialidad y reserva de informaci\xf3n en aquellos casos excepcionales cuya divulgaci\xf3n est\xe9 prohibida, por razones del superior inter\xe9s p\xfablico, de modo expreso y temporal. 9. Denunciar ante la autoridad competente y rechazar cualquier actividad contraria al correcto manejo de los fondos y del inter\xe9s p\xfablico. 10. Tratar a los ciudadanos y a los funcionarios p\xfablicos con absoluto respeto y con apego a la estricta legalidad, prest\xe1ndole sus servicios y colaboraci\xf3n de manera eficiente, puntual y pertinente, sin abusar en modo alguno de la autoridad y atribuciones que le sean conferidas en ocasi\xf3n del cargo que desempe\xf1e.",null,B.F,B.m,null,null,null,null,null)
